import React from "react";
import clsx from "clsx";
import { makeStyles } from "@material-ui/core/styles";
import CssBaseline from "@material-ui/core/CssBaseline";
import Drawer from "@material-ui/core/Drawer";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import List from "@material-ui/core/List";
import Typography from "@material-ui/core/Typography";
import Divider from "@material-ui/core/Divider";
import IconButton from "@material-ui/core/IconButton";
import Badge from "@material-ui/core/Badge";
import MenuIcon from "@material-ui/icons/Menu";
import ChevronLeftIcon from "@material-ui/icons/ChevronLeft";
import NotificationsIcon from "@material-ui/icons/Notifications";
import { Route, Switch } from "react-router-dom";
import Main from "./main";
import ANotifications from "./notifications";
import { Link } from "react-router-dom";
import ListItem from "@material-ui/core/ListItem";
import ListItemIcon from "@material-ui/core/ListItemIcon";
import ListItemText from "@material-ui/core/ListItemText";
import DashboardIcon from "@material-ui/icons/Dashboard";
import PolicyIcon from "@material-ui/icons/Policy";
import PeopleIcon from "@material-ui/icons/People";
import NotificationImportantIcon from "@material-ui/icons/NotificationImportant";
import HighlightOffIcon from "@material-ui/icons/HighlightOff";
import PermIdentityIcon from "@material-ui/icons/PermIdentity";
import AccessibilityNewIcon from "@material-ui/icons/AccessibilityNew";
import MenuItem from "@material-ui/core/MenuItem";
import Users from "./users";
import GranPermission from "./grantPermissions";
import PrivatePolicies from "./privacyPolicies";
import Limitsconstraints from "./limitsConstraints";
import RequestAccess from "./accessRequests";

const drawerWidth = 240;

const useStyles = makeStyles(theme => ({
  root: {
    display: "flex"
  },
  toolbar: {
    paddingRight: 24 // keep right padding when drawer closed
  },
  toolbarIcon: {
    display: "flex",
    alignItems: "center",
    justifyContent: "flex-end",
    padding: "0 8px",
    ...theme.mixins.toolbar
  },
  appBar: {
    zIndex: theme.zIndex.drawer + 1,
    transition: theme.transitions.create(["width", "margin"], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen
    })
  },
  appBarShift: {
    marginLeft: drawerWidth,
    width: `calc(100% - ${drawerWidth}px)`,
    transition: theme.transitions.create(["width", "margin"], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen
    })
  },
  menuButton: {
    marginRight: 36
  },
  menuButtonHidden: {
    display: "none"
  },
  title: {
    flexGrow: 1
  },
  drawerPaper: {
    position: "relative",
    whiteSpace: "nowrap",
    width: drawerWidth,
    transition: theme.transitions.create("width", {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen
    })
  },
  drawerPaperClose: {
    overflowX: "hidden",
    transition: theme.transitions.create("width", {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen
    }),
    width: theme.spacing(7),
    [theme.breakpoints.up("sm")]: {
      width: theme.spacing(9)
    }
  },
  appBarSpacer: theme.mixins.toolbar,
  content: {
    flexGrow: 1,
    height: "100vh",
    overflow: "auto"
  },
  container: {
    paddingTop: theme.spacing(4),
    paddingBottom: theme.spacing(4)
  },
  paper: {
    padding: theme.spacing(2),
    display: "flex",
    overflow: "auto",
    flexDirection: "column"
  },
  fixedHeight: {
    height: 240
  }
}));

export default function AdminDashboard(props) {
  const classes = useStyles();

  const [open, setOpen] = React.useState(true);
  const handleDrawerOpen = () => {
    setOpen(true);
  };
  const handleDrawerClose = () => {
    setOpen(false);
  };

  return (
    <div className={classes.root}>
      <CssBaseline />
      <AppBar
        position="absolute"
        className={clsx(classes.appBar, open && classes.appBarShift)}
      >
        <Toolbar className={classes.toolbar}>
          <IconButton
            edge="start"
            color="inherit"
            aria-label="open drawer"
            onClick={handleDrawerOpen}
            className={clsx(
              classes.menuButton,
              open && classes.menuButtonHidden
            )}
          >
            <MenuIcon />
          </IconButton>
          <Typography
            component="h1"
            variant="h6"
            color="inherit"
            noWrap
            className={classes.title}
          >
            {"Dashboard"}
          </Typography>
          <IconButton color="inherit">
            <Badge badgeContent={4} color="secondary">
              <NotificationsIcon />
            </Badge>
          </IconButton>
        </Toolbar>
      </AppBar>
      <Drawer
        variant="permanent"
        classes={{
          paper: clsx(classes.drawerPaper, !open && classes.drawerPaperClose)
        }}
        open={open}
      >
        <div className={classes.toolbarIcon}>
          <IconButton onClick={handleDrawerClose}>
            <ChevronLeftIcon />
          </IconButton>
        </div>
        <Divider />
        <List>
          <ListItem button>
            <ListItemIcon>
              <DashboardIcon fontSize="large" />
            </ListItemIcon>
            <Link to="/admindashboard"></Link>
            Dashboard
          </ListItem>
          <ListItem button>
            <ListItemIcon>
              <NotificationImportantIcon fontSize="large" />
            </ListItemIcon>
            <MenuItem
              component={Link}
              to="/admindashboard/notifications"
              selected={
                "/admindashboard/notifications" === props.location.pathname
              }
            >
              Notifications
            </MenuItem>
          </ListItem>
          <ListItem button>
            <ListItemIcon>
              <PeopleIcon fontSize="large" />
            </ListItemIcon>
            <MenuItem
              component={Link}
              to="/admindashboard/users"
              selected={"/admindashboard/users" === props.location.pathname}
            >
              Users
            </MenuItem>
          </ListItem>
          <ListItem button>
            <ListItemIcon>
              <PermIdentityIcon fontSize="large" />
            </ListItemIcon>
            <MenuItem
              component={Link}
              to="/admindashboard/grantpermissions"
              selected={
                "/admindashboard/grantpermissions" === props.location.pathname
              }
            >
              Grant Permissions
            </MenuItem>
          </ListItem>
          <ListItem button>
            <ListItemIcon>
              <HighlightOffIcon fontSize="large" />
            </ListItemIcon>
            <MenuItem
              component={Link}
              to="/admindashboard/limitsconstraints"
              selected={
                "/admindashboard/limitsconstraints" === props.location.pathname
              }
            >
              {"Limits & Constraints"}
            </MenuItem>
          </ListItem>
          <ListItem button>
            <ListItemIcon>
              <AccessibilityNewIcon fontSize="large" />
            </ListItemIcon>
            <MenuItem
              component={Link}
              to="/admindashboard/requestaccess"
              selected={
                "/admindashboard/requestaccess" === props.location.pathname
              }
            >
              Request Access
            </MenuItem>
          </ListItem>
          <ListItem button>
            <ListItemIcon>
              <PolicyIcon fontSize="large" />
            </ListItemIcon>
            <MenuItem
              component={Link}
              to="/admindashboard/privacypolicies"
              selected={
                "/admindashboard/privacypolicies" === props.location.pathname
              }
            >
              Privacy Policy
            </MenuItem>
          </ListItem>
        </List>
        <Divider />
      </Drawer>

      <Switch>
        <Route exact path="/admindashboard" component={Main} />
        <Route exact path="/admindashboard/users" component={Users} />
        <Route
          exact
          path="/admindashboard/notifications"
          component={ANotifications}
        />
        <Route
          exact
          path="/admindashboard/grantpermissions"
          component={GranPermission}
        />
        <Route
          exact
          path="/admindashboard/privacypolicies"
          component={PrivatePolicies}
        />
        <Route
          exact
          path="/admindashboard/limitsconstraints"
          component={Limitsconstraints}
        />
        <Route
          exact
          path="/admindashboard/requestaccess"
          component={RequestAccess}
        />
      </Switch>
    </div>
  );
}
